  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0108123 includes Surface
  underway, discrete sample and profile data collected from MIRAI in the Bering Sea,
  North Pacific Ocean and South Pacific Ocean from 2007-10-08 to 2007-12-26 and retrieved
  during cruise CLIVAR_P14_2007. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride
  (CCL4), DELTA CARBON-13, DELTA CARBON-14, DISSOLVED INORGANIC CARBON (DIC), DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, Potential temperature (theta), SALINITY,
  TOTAL ALKALINITY (TA), WATER TEMPERATURE, pH, phosphate and silicate. The instruments
  used to collect these data include Alkalinity titrator, CTD, Carbon dioxide (CO2)
  gas analyzer, Coulometer for DIC measurement, Shower head chamber equilibrator for
  autonomous carbon dioxide (CO2) measurement, bottle and spectrophotometer.nnThese
  data were collected by Akihiko Murata, Masao Fukasawa and Takeshi Kawano of Japan
  Agency for Marine-Earth Science and Technology (JAMSTEC) as part of the CLIVAR_P14_2007
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
